const handleErrors = (response) => {
    if(!response.ok){
        let errorMessage = {'error': response.statusText}
        return errorMessage
    }   
    return response
}

export default async function getDish(url){
    return await fetch(url)
        .then(handleErrors)
        .then((res) => {
        try {
            console.log(res.json().data)
            res.json()
        }
        catch {
            console.log(res)
        }
    })
}
